import React from 'react'
import './video.css'



const Video = () => {
    return (
        <div >
            <section className='video'>
                
            <iframe  src="https://www.youtube.com/embed/qdfZd-eocjU" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen className='trip'></iframe>
            </section>
            
        </div>
    )
}

export default Video
